Как быстро Вы заговорите на английском?🤔
🌲конечно , с первого урока, который предполагает набор определённых фраз и диалогов, основанных на минимальных знаниях и лексике;
🌲в течение месяца можно будет общаться на элементарные темы, рассказать о себе и о своей семье , зарегистрироваться в отеле заграницей;
🌲через полгода вы будете знать несколько времён , сумеете рассказать о своих планах на будущее и своём прошлом;
🌲далее изучение языка растягивается на всю жизнь, я до сих пор учусь , встречая новые слова и выражения, и это очень интересно, поверьте💖💖💖
